import React from 'react'
import './Signup.css'
import Form from 'react-bootstrap/Form'
// import Button from 'react-bootstrap/Button'
// import {Redirect} from 'react-router-dom'
import {useHistory} from 'react-router';

export default function Signup() {
    var state = {
        Username : "" ,
        Email : '',
        Password : ''
    }
    function hangleGet(event){
    var target = event.target;
    var Username = target.name;
    var value = target.value;


      Username = value

    };


    const history = useHistory();
    function handleClick() {
        history.push("/");
    }
    // console.log(state.Username)
    return (

        <div className ="div-from ">
            <Form action = "" className = "form999">
                <div className="container">
                <hr/>
                <h1 className = "h1sign">Sign Up</h1>
                <label for="email">Email<b/></label>
                <input onChange = {hangleGet} type = "text" placeholder="Enter Email" name = "email" required></input>
                <label for="username">Username</label>
                <input type="text" placeholder="Enter Username" name = "username" required></input>
                <label for="psw">Password<b/></label>
                <input type = "password" placeholder="Enter Password" name = "psw" required></input>

                <label for="pswrepeat">Confirm Password<b/></label>
                <input type = "password" placeholder="Confirm Password" name = "psw-repeat" required></input>

                <div class="clearfix">
                    <button type="submit" class="signupbtn">Sign Up</button>
                    <button type="button" class="cancelbtn" onClick = {handleClick}>Cancel</button>
                </div>

                </div>
            </Form>
        </div>
    );
}
